import Background from "../components/Background";
import Dashboard from "./components/Dashboard";
import SidePanel from "./components/SidePanel";

function App() {
  return (
    <div className="App">
      <SidePanel/>
      <Background/>
      <Dashboard/>
    </div>
  );
}

export default App;
